import React from 'react';

//css
import style from './Header.module.scss';

// image
import MobileMenuButton from '../../image/mobileMemu.png';

const Header = () => {
  return (
    <div className={style.header}>
      <h1>わたしのクレジットカード</h1>
      <div className={style.mobilemenu}>
      </div>
        <img src={MobileMenuButton} alt='header menu' />
    </div>
  )
}

export default Header
